import React,{ Component } from 'react';
import './App.css';
import "material-components-web/dist/material-components-web.min.css";
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import { Tabs } from "@yazanaabed/react-tabs";
import UpcomingLaunches from './component/Upcominglaunches.js';
import AllLaunches from './component/All-launches.js';
import Twitter from './component/Twitter.js';



  class App extends Component{

    render(){
        return(
          <div className="body_content">
          <div className="mdc-layout-grid">
          <div className="mdc-layout-grid__inner header">
          <div className="mdc-layout-grid__cell--span-7">
          <p className='title'>Find Near Earth Objects</p>
          </div>
          </div>
          <div className="mdc-layout-grid__inner">
          <div className="mdc-layout-grid__cell--span-12">
          <Router>
          <Switch>
          <div>
          <Tabs
          activeTab={{
            id: "UpcomingLaunches"
          }}
          >
          <Tabs.Tab id="UpcomingLaunches" title="UpcomingLaunches">
          <div style={{ padding: 10 }}>
          <Route component={UpcomingLaunches} />
          </div>
          </Tabs.Tab>
          <Tabs.Tab id="AllLaunches" title="AllLaunches">
          <div style={{ padding: 10 }}>
          <Route component={AllLaunches} />
          </div>
          </Tabs.Tab>
          <Tabs.Tab id="Twitter" title="Twitter">
          <div style={{ padding: 10 }}>
          <Route component={Twitter} />
          </div>
          </Tabs.Tab>
          </Tabs>
          </div>
          </Switch>
          </Router>
          </div>
          </div>
          </div>
          </div>
          )
      }
   }

export default App;
